# 1121. 将数组分成几个递增序列
# https://leetcode-cn.com/problems/divide-array-into-increasing-sequences/

class Solution(object):
    def canDivideIntoSubsequences(self, nums, K):
        """
        :type nums: List[int]
        :type K: int
        :rtype: bool
        """
        if not nums:
            return False
        tmps = [[nums[0]]]
        lens = {1: [[nums[0]]]}
        for i in range(1, len(nums)):
            isAdd = False

            keys = sorted(lens.keys())
            for key in keys:
                if lens[key]:
                    if key >= K and len(nums) - 1 - i >= K:
                        if 1 in lens:
                            lens[1].append([nums[i]])
                        else:
                            lens[1] = [[nums[i]]]
                        isAdd = True
                    break
            if isAdd:
                continue
            # if keys[0] >= K and len(nums) - 1 - i >= K:
            #     lens[1].append([nums[i]])
            #     continue
            for key in keys:

                for j in range(len(lens[key])):
                    seq = lens[key][j]
                    if seq[-1] < nums[i]:
                        lens[key].pop(j)
                        if not lens[key]:
                            lens.pop(key)
                        seq.append(nums[i])
                        if key+1 in lens:
                            lens[key+1].append(seq)
                        else:
                            lens[key+1] = [seq]
                        isAdd = True
                        break
                if isAdd:
                    break
            if not isAdd:
                if 1 in lens:
                    lens[1].append([nums[i]])
                else:
                    lens[1] = [[nums[i]]]
        keys = sorted(lens.keys())
        # print(lens)
        for key in keys:
            if key >= K:
                return True
            else:
                if lens[key]:
                    return False
        return True


